    locale: 'en_AU',
    country: 'AU',
    limit: '50',
    offset: '1',
  });

  const [loading, setLoading] = useState(false);

  const getPlayList = async (params = '') => {
    setLoading(true);
    const responsePlaylist = await callBuildings(params);
    console.log(responsePlaylist)
    // if (responsePlaylist && responsePlaylist.playlists.items){
    //   setListMusic(responsePlaylist.playlists.items);
    //   setHistory(responsePlaylist.playlists.items);
    // }

    setTimeout(() => {
      setLoading(false);
    }, 500);
  };

  useEffect(() => {
    getPlayList(filters);
  }, [filters]);

  return (
    <div className="app">
      <div className={classes.container}>

      </div>
    </div>
  );
}

export default App;
